<div class="wrapper clearfix">
    <div class=screen2>
        <h1 class=screen-h1>Что такое <em>фиксатор Валюфикс<sup>&#9415;</sup>?</em></h1>
        <div class=screen2-text>
            <b>Валюфикс &#9415;</b> является разработкой института Фраунгофера в Германии. Созданная совместными усилиями ученых и ведущих немецких врачей ортопедов, шина <b>Валюфикс &#9415;</b> учитывает все аспекты биомеханики стопы.<br><br>
